          "personName": "Chris",
          "personPhone": "95695968",
          "description": "something something something something something something something something "
        }
    ]
    return (
      <div>
         {names.map((name, index) => {
          return (
              <div>
                <h1>{name.personName}</h1>
                <strong>{name.personPhone}</strong>
                <p>description: {name.description}</p>
                <hr/>
              </div>
            )
         })} 
      </div>
    )
  }
}




export default App;
